import React from 'react';
import './ActualTab.css';

function LoginForm() {
    var login_form = (
        <div className="div-style">
            <h1>letterBox</h1>
            <form>
                <input className="input-style" placeholder="Name" type="text" /><br></br>
                <input style="display : center;" placeholder="Phone" type="number" />
            </form>
        </div>
    );

    return login_form;
};

export default LoginForm;
